B8\" title=\"\u0428\u0442\u0443\u0440\u043c \u0415\u0432\u043f\u0430\u0442\u043e\u0440\u0438\u0438\">\u0428\u0442\u0443\u0440\u043c \u0415\u0432\u043f\u0430\u0442\u043e\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1859_%D0%B3%D0%BE%D0%B4\" title=\"1859 \u0433\u043e\u0434\">1859<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%85%D0%B8%D0%BD%D1%85%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041a\u043e\u0445\u0438\u043d\u0445\u0438\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f\">\u041a\u043e\u0445\u0438\u043d\u0445\u0438\u043d\u0441\u043a\u043e\u0439 \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438<\/a> \u043f\u043e\u0441\u043b\u0435 \u0434\u0432\u0443\u0445\u0434\u043d\u0435\u0432\u043d\u043e\u0439 <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Siege_of_Saigon\">\u043e\u0441\u0430\u0434\u044b<\/a> \u0444\u0440\u0430\u043d\u043a\u043e-\u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0435 \u0441\u0438\u043b\u044b \u0432\u0437\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B9%D0%B3%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u0421\u0430\u0439\u0433\u043e\u043d\">\u0421\u0430\u0439\u0433\u043e\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863_%D0%B3%D0%BE%D0%B4\" title=\"1863 \u0433\u043e\u0434\">1863<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_(1863)\" class=\"mw-redirect\" title=\"\u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 (1863)\">\u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f 1863 \u0433\u043e\u0434\u0430<\/a> \u043f\u0440\u04